import villaPalma from '../img/portfolio/V02/exterior/IMG_0365.avif';
import villaOlivia from '../img/portfolio/V03/HR Villa Olivia-003.avif';
import cotoReal from '../img/portfolio/V04/OBRAS.avif';

export default function ProjectMenu() {
  return (
    <div id="proyect-menu">
      <div className="section-title text-center center">
        <div className="overlay">
          <h2>Proyectos</h2>
          <hr />
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit duis sed.</p>
        </div>
      </div>
      <div className='d-flex flex-wrap justify-content-between'>
        <div className='container'>
          <div className='row'>
            <Project
                title={"Villa Florence"}
                location={"Ubicación"}
                description={"Lorem ipsum dolor sit amet, consectetur adipiscing elit, duis sed dapibus leo nec ornare diam."}
                img={ villaFlorence }
                />
            <Project
                title={"Villa Palma"}
                location={"Ubicación"}
                description={"Lorem ipsum dolor sit amet, consectetur adipiscing elit, duis sed dapibus leo nec ornare diam."}
                img={ villaPalma }
                />
          </div>
          <div className='row'>
            <Project
                title={"Villa Olivia"}
                location={"Ubicación"}
                description={"Lorem ipsum dolor sit amet, consectetur adipiscing elit, duis sed dapibus leo nec ornare diam."}
                img={ villaOlivia }
                />
            <Project
                title={"Coto Real"}
                location={"Ubicación"}
                description={"Lorem ipsum dolor sit amet, consectetur adipiscing elit, duis sed dapibus leo nec ornare diam."}
                img={ cotoReal }
                /> 
          </div>
        </div>

      </div>
    </div>
  )
}
